In JavaScript, objects are used instead of dictionaries. However, you can achieve similar functionality using objects and then sorting their keys alphabetically. Here's an example:

```javascript
// Create an object (similar to a dictionary) with some key-value pairs
const obj = {
  b: 'banana',
  c: 'cherry',
  a: 'apple',
};

// Sort the keys of the object alphabetically and store it in a new array
const sortedKeys = Object.keys(obj).sort();

// Output the values sorted by their keys (alphabetically)
sortedKeys.forEach(key => {
  console.log(`Key: ${key}, Value: ${obj[key]}`);
});
```

The output will be:

```
Key: a, Value: apple
Key: b, Value: banana
Key: c, Value: cherry
```
